import styled from "styled-components";
import { Swiper, SwiperSlide } from "swiper/react";
import SwiperCore, { Navigation } from "swiper";
import "swiper/swiper-bundle.min.css";
import "swiper/swiper.min.css";
import "swiper/components/navigation/navigation.min.css";

import { RewardItem } from "./Item";

SwiperCore.use([Navigation]);

export const ComponentRewardList = () => {
    return (
        <StyledContainer>
            <div className="money">200 points</div>
            {/* <div className="list-reward"> */}
            <Swiper slidesPerView={1.5} spaceBetween={16}>
                <SwiperSlide>
                    <RewardItem />
                </SwiperSlide>
                <SwiperSlide>
                    <RewardItem />
                </SwiperSlide>
                <SwiperSlide>
                    <RewardItem />
                </SwiperSlide>
            </Swiper>
            {/* </div> */}
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 90%;
    margin: 0 auto;
    padding: 25px 0;
    position: relative;
    .money {
        font-style: normal;
        font-weight: 600;
        font-size: 16px;
        line-height: 21px;
        color: #a7a7a7;
        margin-bottom: 12px;
    }
    .list-reward {
        display: flex;
    }
`;
